    }

    @Test
    fun testACaso() {
        val rawCbor = android.util.Base64.decode(mockPagoPA, android.util.Base64.NO_WRAP)
        print(CBORObject.DecodeFromBytes(rawCbor).toModelMDoc().toJson(true))
    }
